import "./App.css";
import Login from "./Pages/LoginPage/Login";
import Register from "./Pages/RegisterPage/Register";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  const user = true;
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/register" element={<Register />}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
